package net.jeeshop.web.action.manage.orderlog;import net.jeeshop.core.BaseAction;import net.jeeshop.services.manage.orderlog.OrderlogService;import net.jeeshop.services.manage.orderlog.bean.Orderlog;public class OrderlogAction extends BaseAction<Orderlog> {	private static final long serialVersionUID = 1L;	private OrderlogService orderlogService;	public OrderlogService getOrderlogService() {		return orderlogService;	}	@Override	protected void selectListAfter() {		pager.setPagerUrl("orderlog!selectList.action");	}	public void setOrderlogService(OrderlogService orderlogService) {		this.orderlogService = orderlogService;	}	@Override	public Orderlog getE() {		return this.e;	}	@Override	public void prepare() throws Exception {		if (this.e == null) {			this.e = new Orderlog();		}	}	@Override	public void insertAfter(Orderlog e) {		e.clear();	}}